import React from 'react'
import { SidebarData } from './SidebarData'


export default function Sidebar() {
  return (
       <React.Fragment>
        <section>
          <div class='text-white'>
            {
              SidebarData.map((item,index)=>
                {
                  return(
                    <div key={index}>
                      </div>
                  )
                }
              )
            }
          </div>
        </section>
       </React.Fragment>
  )
}
